  import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate, useParams, useNavigate } from 'react-router-dom';
 
import AccountDetails from './components/AccountDetails';
import CreateAccountForm from './components/CreateAccountForm';
import DepositForm from './components/DepositForm';
import WithdrawForm from './components/WithdrawForm';
import TransferForm from './components/TransferForm';

function App() {
  const [selectedAccountId, setSelectedAccountId] = useState(null);

  return (
    <Router>
      <div style={{ fontFamily: 'Arial, sans-serif', backgroundColor: '#f7f7f7', minHeight: '100vh' }}>
        <nav style={{
          backgroundColor: '#fff',
          padding: '1rem 2rem',
          borderBottom: '1px solid #ccc',
          display: 'flex',
          gap: '1rem'
        }}>
          <Link to="/accounts" style={{ textDecoration: 'none', color: '#333', fontWeight: 'bold' }}>Accounts</Link>
          <Link to="/create" style={{ textDecoration: 'none', color: '#333', fontWeight: 'bold' }}>Create Account</Link>
          <Link to="/deposit" style={{ textDecoration: 'none', color: '#333', fontWeight: 'bold' }}>Deposit</Link>
          <Link to="/withdraw" style={{ textDecoration: 'none', color: '#333', fontWeight: 'bold' }}>Withdraw</Link>
          <Link to="/transfer" style={{ textDecoration: 'none', color: '#333', fontWeight: 'bold' }}>Transfer</Link>
        </nav>

        <div style={{ padding: '2rem' }}>
          <Routes>
            <Route path="/" element={<Navigate to="/accounts" replace />} />

            <Route path="/accounts" element={<AccountList />} />
            <Route path="/accounts/:accountId" element={<AccountDetailsWrapper />} />
            <Route path="/create" element={<CreateAccountForm />} />
            <Route path="/deposit" element={<DepositForm />} />
            <Route path="/withdraw" element={<WithdrawForm />} />
            <Route path="/transfer" element={<TransferForm />} />
            <Route path="*" element={<h2>404 - Page Not Found</h2>} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

// Wrapper to pass accountId param
function AccountDetailsWrapper() {
  const { accountId } = useParams();
  return <AccountDetails accountId={parseInt(accountId)} />;
}

export default App;
